import React from 'react';
import { NavLink } from 'react-router-dom';

const Nav = () => {
    return (
        <nav>

            <ul>
                <li><NavLink to="/about" className='link-item'>accueil</NavLink></li>
                <li><NavLink to="/about" className='link-item'>accueil</NavLink></li>
                <li><NavLink to="/about" className='link-item'>accueil</NavLink></li>
                <li><NavLink to="/about" className='link-item'>accueil</NavLink></li>
            </ul>       
        </nav> 
    );
};

export default Nav;
